00265                     identifierToken = (IdentifierToken)model.TokenWalker.Match(SyntaxKind.IdentifierToken);
00266                 }
00267                 else
00268                 {
00269                     // Initialization Case Four
00270                     //     bad syntax?
00271                     badStateInitialization = true;
00272                 }
