00282                 initializationExpressionNode = ParseOthers.ParseExpression(model);
00283                 
00284                 initializationStatementDelimiterToken = (StatementDelimiterToken)model.TokenWalker.Match(SyntaxKind.StatementDelimiterToken);
00285             }
