00711     public static void HandleIfTokenKeyword(CSharpParserModel model)
00712     {
00713         var ifTokenKeyword = (KeywordToken)model.TokenWalker.Consume();
00714         
00715         var openParenthesisToken = model.TokenWalker.Match(SyntaxKind.OpenParenthesisToken);
00716 
00717         if (openParenthesisToken.IsFabricated)
00718             return;
00719 
00720         model.ExpressionList.Add((SyntaxKind.CloseParenthesisToken, null));
00721         var expression = ParseOthers.ParseExpression(model);
00722 
00723         var boundIfStatementNode = model.Binder.BindIfStatementNode(ifTokenKeyword, expression);
00724         model.SyntaxStack.Push(boundIfStatementNode);
00725         model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = boundIfStatementNode;
00726     }
