00728     public static void HandleUsingTokenKeyword(CSharpParserModel model)
00729     {
00730         var usingKeywordToken = (KeywordToken)model.TokenWalker.Consume();
00731         
00732         var handleNamespaceIdentifierResult = ParseOthers.HandleNamespaceIdentifier(model);
00733 
00734         if (handleNamespaceIdentifierResult.SyntaxKind == SyntaxKind.EmptyNode)
00735         {
00736             model.DiagnosticBag.ReportTodoException(usingKeywordToken.TextSpan, "Expected a namespace identifier.");
00737             return;
00738         }
00739         
00740         var namespaceIdentifier = (IdentifierToken)handleNamespaceIdentifierResult;
00741 
00742         var usingStatementNode = new UsingStatementNode(
00743             usingKeywordToken,
00744             namespaceIdentifier);
00745 
00746         model.Binder.BindUsingStatementNode(usingStatementNode, model);
00747         model.StatementBuilder.ChildList.Add(usingStatementNode);
00748     }
