00766     public static void HandleStorageModifierTokenKeyword(CSharpParserModel model)
00767     {
00768         var storageModifierToken = model.TokenWalker.Consume();
00769         
00770         // Given: public partial class MyClass { }
00771         // Then: partial
00772         var hasPartialModifier = false;
00773         if (model.StatementBuilder.TryPeek(out var syntax) && syntax is ISyntaxToken syntaxToken)
00774         {
00775             if (syntaxToken.SyntaxKind == SyntaxKind.PartialTokenContextualKeyword)
00776             {
00777                 _ = model.StatementBuilder.Pop();
00778                 hasPartialModifier = true;
00779             }
00780         }
00781     
00782         // TODO: Fix; the code that parses the accessModifierKind is a mess
00783         //
00784         // Given: public class MyClass { }
00785         // Then: public
00786         var accessModifierKind = AccessModifierKind.Public;
00787         if (model.StatementBuilder.TryPeek(out syntax) && syntax is ISyntaxToken firstSyntaxToken)
00788         {
00789             var firstOutput = UtilityApi.GetAccessModifierKindFromToken(firstSyntaxToken);
00790 
00791             if (firstOutput is not null)
00792             {
00793                 _ = model.StatementBuilder.Pop();
00794                 accessModifierKind = firstOutput.Value;
00795 
00796                 // Given: protected internal class MyClass { }
00797                 // Then: protected internal
00798                 if (model.StatementBuilder.TryPeek(out syntax) && syntax is ISyntaxToken secondSyntaxToken)
00799                 {
00800                     var secondOutput = UtilityApi.GetAccessModifierKindFromToken(secondSyntaxToken);
00801 
00802                     if (secondOutput is not null)
00803                     {
00804                         _ = model.StatementBuilder.Pop();
00805 
00806                         if ((firstOutput.Value.ToString().ToLower() == "protected" &&
00807                                 secondOutput.Value.ToString().ToLower() == "internal") ||
00808                             (firstOutput.Value.ToString().ToLower() == "internal" &&
00809                                 secondOutput.Value.ToString().ToLower() == "protected"))
00810                         {
00811                             accessModifierKind = AccessModifierKind.ProtectedInternal;
00812                         }
00813                         else if ((firstOutput.Value.ToString().ToLower() == "private" &&
00814                                     secondOutput.Value.ToString().ToLower() == "protected") ||
00815                                 (firstOutput.Value.ToString().ToLower() == "protected" &&
00816                                     secondOutput.Value.ToString().ToLower() == "private"))
00817                         {
00818                             accessModifierKind = AccessModifierKind.PrivateProtected;
00819                         }
00820                         // else use the firstOutput.
00821                     }
00822                 }
00823             }
00824         }
00825     
00826         // TODO: Fix nullability spaghetti code
00827         var storageModifierKind = UtilityApi.GetStorageModifierKindFromToken(storageModifierToken);
00828         if (storageModifierKind is null)
00829             return;
00830         if (storageModifierKind == StorageModifierKind.Record &&
00831             model.TokenWalker.Current.SyntaxKind == SyntaxKind.StructTokenKeyword)
00832         {
00833             var structKeywordToken = (KeywordToken)model.TokenWalker.Consume();
00834             storageModifierKind = StorageModifierKind.RecordStruct;
00835         }
00836     
00837         // Given: public class MyClass<T> { }
00838         // Then: MyClass
00839         IdentifierToken identifierToken;
00840         // Retrospective: What is the purpose of this 'if (contextualKeyword) logic'?
00841         // Response: maybe it is because 'var' contextual keyword is allowed to be a class name?
00842         if (UtilityApi.IsContextualKeywordSyntaxKind(model.TokenWalker.Current.SyntaxKind))
00843         {
00844             var contextualKeywordToken = (KeywordContextualToken)model.TokenWalker.Consume();
00845             // Take the contextual keyword as an identifier
00846             identifierToken = new IdentifierToken(contextualKeywordToken.TextSpan);
00847         }
00848         else
00849         {
00850             identifierToken = (IdentifierToken)model.TokenWalker.Match(SyntaxKind.IdentifierToken);
00851         }
00852 
00853         // Given: public class MyClass<T> { }
00854         // Then: <T>
00855         GenericArgumentsListingNode? genericArgumentsListingNode = null;
00856         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenAngleBracketToken)
00857             genericArgumentsListingNode = ParseTypes.HandleGenericArguments(model);
00858 
00859         var typeDefinitionNode = new TypeDefinitionNode(
00860             accessModifierKind,
00861             hasPartialModifier,
00862             storageModifierKind.Value,
00863             identifierToken,
00864             valueType: null,
00865             genericArgumentsListingNode,
00866             primaryConstructorFunctionArgumentsListingNode: null,
00867             inheritedTypeClauseNode: null,
00868             openBraceToken: default,
00869             codeBlockNode: null);
00870 
00871         model.Binder.BindTypeDefinitionNode(typeDefinitionNode, model);
00872         model.Binder.BindTypeIdentifier(identifierToken, model);
00873         model.SyntaxStack.Push(typeDefinitionNode);
00874         model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = typeDefinitionNode;
00875     }
