00882     public static void HandleNamespaceTokenKeyword(CSharpParserModel model)
00883     {
00884         var namespaceKeywordToken = (KeywordToken)model.TokenWalker.Consume();
00885         
00886         var handleNamespaceIdentifierResult = ParseOthers.HandleNamespaceIdentifier(model);
00887 
00888         if (handleNamespaceIdentifierResult.SyntaxKind == SyntaxKind.EmptyNode)
00889         {
00890             model.DiagnosticBag.ReportTodoException(namespaceKeywordToken.TextSpan, "Expected a namespace identifier.");
00891             return;
00892         }
00893         
00894         var namespaceIdentifier = (IdentifierToken)handleNamespaceIdentifierResult;
00895 
00896         var namespaceStatementNode = new NamespaceStatementNode(
00897             namespaceKeywordToken,
00898             namespaceIdentifier,
00899             null);
00900 
00901         model.Binder.SetCurrentNamespaceStatementNode(namespaceStatementNode, model);
00902         
00903         model.SyntaxStack.Push(namespaceStatementNode);
00904         model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = namespaceStatementNode;
00905     }
